import React from 'react';
import styled from 'styled-components';

function CardMaker(props) {
    const {nmName, nmEmail, nmRole} = props
    return (
        <StyledCard>
            <h2>{nmName}</h2>
            <h2>{nmRole}</h2>
            <h2>{nmEmail}</h2>
        </StyledCard>
    )
}
const StyledCard = styled.div`
    box-shadow: 2px 2px 2px;


`
export default CardMaker
